pragma solidity ^0.5.8;

interface CTokenInterface {
    function mint(uint mintAmount) external returns (uint); // For ERC20
    function redeem(uint redeemTokens) external returns (uint);
    function redeemUnderlying(uint redeemAmount) external returns (uint);
    function exchangeRateCurrent() external returns (uint);
    function transfer(address, uint) external returns (bool);
    function transferFrom(address, address, uint) external returns (bool);
    function balanceOf(address) external view returns (uint);
}

interface ERC20Interface {
    function allowance(address, address) external view returns (uint);
    function balanceOf(address) external view returns (uint);
    function approve(address, uint) external;
    function transfer(address, uint) external returns (bool);
    function transferFrom(address, address, uint) external returns (bool);
    function deposit() external payable;
    function withdraw(uint) external;
}

interface CETHInterface {
    function mint() external payable; // For ETH
    function transfer(address, uint) external returns (bool);
}

interface CDAIInterface {
    function mint(uint mintAmount) external returns (uint); // For ERC20
    function repayBorrowBehalf(address borrower, uint repayAmount) external returns (uint);
    function borrowBalanceCurrent(address account) external returns (uint);
}

contract DSMath {

    function add(uint x, uint y) internal pure returns (uint z) {
        require((z = x + y) >= x, "math-not-safe");
    }

    function mul(uint x, uint y) internal pure returns (uint z) {
        require(y == 0 || (z = x * y) / y == x, "math-not-safe");
    }

    uint constant WAD = 10 ** 18;
    uint constant RAY = 10 ** 27;

    function rmul(uint x, uint y) internal pure returns (uint z) {
        z = add(mul(x, y), RAY / 2) / RAY;
    }

    function rdiv(uint x, uint y) internal pure returns (uint z) {
        z = add(mul(x, RAY), y / 2) / y;
    }

    function wmul(uint x, uint y) internal pure returns (uint z) {
        z = add(mul(x, y), WAD / 2) / WAD;
    }

    function wdiv(uint x, uint y) internal pure returns (uint z) {
        z = add(mul(x, WAD), y / 2) / y;
    }

    function sub(uint a, uint b) internal pure returns (uint c) {
        require(b <= a, "SafeMath: subtraction overflow");
        c = a - b;
    }

}

contract Helper is DSMath{

    address public cEth = 0xd6801a1DfFCd0a410336Ef88DeF4320D6DF1883e;
    address public Dai  = 0x5592EC0cfb4dbc12D3aB100b257153436a1f0FEa;
    address public cDai = 0x6D7F0754FFeb405d23C51CE938289d4835bE3b14;
}

contract CompoundResolver is Helper {

    /**
     * @dev Redeem ETH/ERC20 and mint Compound Tokens
     * @param tokenAmt Amount of token To Redeem
     */
    function redeemUnderlying(address cErc20, uint tokenAmt) internal {
        if (tokenAmt > 0) {
            require(CTokenInterface(cErc20).redeemUnderlying(tokenAmt) == 0, "something went wrong");
        }
    }

    /**
     * @dev Deposit ETH/ERC20 and mint Compound Tokens
     */
    function mintCETH(uint ethAmt) internal {
        if (ethAmt > 0) {
            CETHInterface cToken = CETHInterface(cEth);
            cToken.mint.value(ethAmt)();
            uint exchangeRate = CTokenInterface(cEth).exchangeRateCurrent();
            uint cEthToReturn = wdiv(ethAmt, exchangeRate);
            cEthToReturn = wmul(cEthToReturn, exchangeRate) <= ethAmt ? cEthToReturn : cEthToReturn - 1;
            require(cToken.transfer(msg.sender, cEthToReturn), "CETH Transfer failed");
        }
    }
}

contract SecureCredit is CompoundResolver {

    enum TypeLoan{ LoanEther, LoanDAI }

    struct LoanBorrow{
        bytes32 Id;
        uint256 amount;
        uint256 startTime;
        uint256 endTime;
        uint256 timeRepaid;
        bool active;
        bool liquidated;
        TypeLoan loantype;
    }

    // @dev Mapping used to handle the balance of Ether that the user deposited
    mapping(address=>uint256) addressToBalanceEther;
    // @dev Mapping used to handle the balance of DAI that the user deposited
    mapping(address=>uint256) addressToBalanceDAI;
    // @dev Mapping used to handle the balance of Ether lent to Compound
    mapping(address=>uint256) amountCompoundEther;
    // @dev Mapping used to handle the balance of DAI lent to Compound
    mapping(address=>uint256) amountCompoundDAI;
    // @dev Mapping used to handle the balance of Ether deposited minus amount lent
    mapping(address=>uint256) effectiveBalanceEther;
    // @dev Mapping used to handle the balance of DAI deposited minus amount lent
    mapping(address=>uint256) effectiveBalanceDAI;
    // @dev Mapping used to handle the information of the loan
    mapping(address=>LoanBorrow[]) addressToLoan;

    modifier hasCorrectAmount(uint _amount){
      require(_amount > 0, "Amount must be greater than 0");
      _;
    }

    event BorrowedMoney ( address _user, uint256 _amount, uint256 endTime, TypeLoan _loanType );
    event LiquidatedLoan ( address _user, bytes32 Id, uint256 _amount, TypeLoan _loanType );

    //Paying someone using the contract, helps to secure your credit score
    //If you take out the loan, the issue would mainly be the fact, who is the one lending ?


    //The more repaid transaction, the better is the credit score

    function lendToken(uint _tokenAmt) public hasCorrectAmount(_tokenAmt){
        require(_tokenAmt < effectiveBalanceDAI[msg.sender], "Incorrect amount");
        //Check amount is less than addressTo Balance;
        CTokenInterface cToken = CTokenInterface(cDai);
        require(cToken.mint(_tokenAmt) == 0);
        amountCompoundDAI[msg.sender] = add(amountCompoundDAI[msg.sender], _tokenAmt);
        effectiveBalanceDAI[msg.sender] = sub(addressToBalanceDAI[msg.sender], amountCompoundDAI[msg.sender]);
    }


   function() external payable{
       require(msg.value > 0, "Ether amount equal to 0 ");
       addressToBalanceEther[msg.sender] = add(addressToBalanceEther[msg.sender], msg.value);
       effectiveBalanceEther[msg.sender] = sub(addressToBalanceEther[msg.sender], amountCompoundEther[msg.sender]);
   }

   function depositDAI() public {
     uint allowanceDai = ERC20Interface(Dai).allowance(msg.sender, address(this));
     require(ERC20Interface(Dai).transferFrom(msg.sender, address(this), allowanceDai));
     addressToBalanceDAI[msg.sender] = add(addressToBalanceDAI[msg.sender], allowanceDai);
     effectiveBalanceDAI[msg.sender] = sub(addressToBalanceEther[msg.sender], amountCompoundEther[msg.sender]);
   }
    // for Ether
   function lendEther(uint _amount) public payable hasCorrectAmount(_amount){
        require(_amount < effectiveBalanceEther[msg.sender]); // quick check
        //Check amount is less than addressTo Balance;
        mintCETH(_amount);
        amountCompoundEther[msg.sender] = add(amountCompoundEther[msg.sender], _amount);
        effectiveBalanceEther[msg.sender] = sub(addressToBalanceEther[msg.sender], amountCompoundEther[msg.sender] );
   }
    // For Ether
    // The function borrows money, so that if you exceed the limit, you get
    //liquidated
    //Once this has been established, you will have
    function borrowEther(uint256 _amount, uint256 _endTime ) public hasCorrectAmount(_amount){
        require(addressToBalanceEther[msg.sender] >= _amount, "Cannot borrow over limit");
        require(_endTime < now, "End time lower than current time");
        //redeem the token from Compound
        borrowInternalEther(_amount, _endTime);
    }

    function borrowDAI(uint256 _amount, uint256 _endTime) public {
        require(addressToBalanceEther[msg.sender] >= _amount);
        require(_endTime < now, "End time lower than current time");
        borrowInternalDAI(_amount, _endTime);
    }

    function borrowInternalEther(uint256 _amount, uint256 _endTime) internal {
      for( uint i = 0; i<addressToLoan[msg.sender].length; i++){
          if(addressToLoan[msg.sender][i].endTime > now ){
             addressToBalanceEther[msg.sender] = sub(addressToBalanceEther[msg.sender], addressToLoan[msg.sender][i].amount);
             addressToLoan[msg.sender][i].active = false;
             addressToLoan[msg.sender][i].timeRepaid = now;
             addressToLoan[msg.sender][i].liquidated = true;
             emit LiquidatedLoan(msg.sender, addressToLoan[msg.sender][i].Id, addressToLoan[msg.sender][i].amount, TypeLoan.LoanEther);
          }
      }
      effectiveBalanceEther[msg.sender] = sub(effectiveBalanceEther[msg.sender], _amount);
      msg.sender.transfer(_amount);
      addressToLoan[msg.sender].push(LoanBorrow(
        keccak256(abi.encodePacked(msg.sender, _amount,now)),
         _amount,
         now,
         _endTime,
         0,
         true,
         false,
         TypeLoan.LoanEther
       ));
      emit BorrowedMoney(msg.sender, _amount, _endTime, TypeLoan.LoanEther);
    }

    function borrowInternalDAI(uint256 _amount, uint256 _endTime) internal {
      for( uint i = 0; i<addressToLoan[msg.sender].length; i++){
          if(addressToLoan[msg.sender][i].endTime > now && addressToLoan[msg.sender][i].loantype == TypeLoan.LoanDAI ){
             addressToBalanceDAI[msg.sender] = sub(addressToBalanceDAI[msg.sender], addressToLoan[msg.sender][i].amount);
             addressToLoan[msg.sender][i].active = false;
             addressToLoan[msg.sender][i].timeRepaid = now;
             addressToLoan[msg.sender][i].liquidated = true;
             emit LiquidatedLoan(msg.sender, addressToLoan[msg.sender][i].Id, addressToLoan[msg.sender][i].amount, TypeLoan.LoanDAI);
          }
      }
      effectiveBalanceDAI[msg.sender] = sub(effectiveBalanceDAI[msg.sender], _amount);
      ERC20Interface(Dai).transfer(msg.sender, _amount);
      addressToLoan[msg.sender].push(LoanBorrow(
        keccak256(abi.encodePacked(msg.sender, _amount,now)),
         _amount,
         now,
         _endTime,
         0,
         true,
         false,
         TypeLoan.LoanDAI
       ));
      emit BorrowedMoney(msg.sender, _amount, _endTime, TypeLoan.LoanDAI);
    }

    //REPAY THE BORROWED ETHER
}
